import React from "react";
import {
  StyleSheet,
  Platform,
  ScrollView,
  Text,
  SafeAreaView,
  StatusBar,
  ImageBackground,
  Image,
  TouchableOpacity,
  View,
} from "react-native";
import NavBar from "../components/NavBar";

function Login(props) {
  return (
    <SafeAreaView style={styles.container}>
      <NavBar />
      <ScrollView>
        <ImageBackground style={styles.background}>
          <Image
            source={require("../assets/wh-logo.png")}
            style={styles.whLogo}
          />
        </ImageBackground>
      </ScrollView>
    </SafeAreaView>
  );
}

const styles = StyleSheet.create({
  container: {
    backgroundColor: "#000",
    flex: 1,
    resizeMode: "cover",
    justifyContent: "center",
    // alignItems: "center",
    // top: 70
    paddingTop: Platform.OS === "android" ? StatusBar.currentHeight : 0,
  },
  background: {
    flex: 1,
    width: "100%",
    height: "auto",
    backgroundColor: "black",
    alignItems: "center",
  },
  whLogo: {
    // flex: 1,
    width: "80%",
    height: 130,
    resizeMode: "contain",
    position: "absolute",
    marginTop: "10%",
    // marginLeft: "10%",
  },
});

export default Login;
